										<content:encoded><![CDATA[<p>Happy August, internet!  Today&#8217;s image dump of awesome comes from <a href="http://insectlabstudio.com/" target="_blank">Insect Lab Studio</a>, one of the coolest/creepiest sites I&#8217;ve found.  These wonderful little sculptures are for sale on the site, so by the time this post is up some of these might already be sold.  Get &#8216;um while they&#8217;re hot!  Enjoy!</p>
<p><a href="http://192.185.17.126/~cwtwist/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo1_1280.jpg" target="_blank"><img decoding="async" class="wp-image-483 aligncenter" alt="tumblr_mkys8k9PQT1sn3allo1_1280" src="http://192.185.17.126/~cwtwist/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo1_1280.jpg?w=1024" width="553" height="236" srcset="http://clockworktwist.com/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo1_1280.jpg 1102w, http://clockworktwist.com/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo1_1280-300x127.jpg 300w, http://clockworktwist.com/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo1_1280-1024x436.jpg 1024w" sizes="(max-width: 553px) 100vw, 553px" /></a></p>
<p style="text-align:center;"><a href="http://192.185.17.126/~cwtwist/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo2_r1_500.jpg" target="_blank"><img decoding="async" class="alignnone  wp-image-484" style="margin-left:5px;margin-right:5px;" alt="tumblr_mkys8k9PQT1sn3allo2_r1_500" src="http://192.185.17.126/~cwtwist/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo2_r1_500.jpg?w=500" width="231" height="231" srcset="http://clockworktwist.com/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo2_r1_500.jpg 500w, http://clockworktwist.com/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo2_r1_500-150x150.jpg 150w, http://clockworktwist.com/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo2_r1_500-300x300.jpg 300w" sizes="(max-width: 231px) 100vw, 231px" /></a>  <a href="http://192.185.17.126/~cwtwist/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo4_r1_1280.jpg" target="_blank"><img loading="lazy" decoding="async" class="alignnone  wp-image-486" style="margin-left:5px;margin-right:5px;" alt="tumblr_mkys8k9PQT1sn3allo4_r1_1280" src="http://192.185.17.126/~cwtwist/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo4_r1_1280.jpg?w=580" width="278" height="208" srcset="http://clockworktwist.com/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo4_r1_1280.jpg 580w, http://clockworktwist.com/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo4_r1_1280-300x223.jpg 300w" sizes="(max-width: 278px) 100vw, 278px" /></a><img loading="lazy" decoding="async" class=" wp-image-485 aligncenter" alt="tumblr_mkys8k9PQT1sn3allo3_r1_1280" src="http://192.185.17.126/~cwtwist/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo3_r1_1280.jpg?w=580" width="522" height="384" srcset="http://clockworktwist.com/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo3_r1_1280.jpg 580w, http://clockworktwist.com/wp-content/uploads/2013/06/tumblr_mkys8k9pqt1sn3allo3_r1_1280-300x220.jpg 300w" sizes="(max-width: 522px) 100vw, 522px" /><a href="http://192.185.17.126/~cwtwist/wp-content/uploads/2013/06/2011crab.jpg" target="_blank"><img loading="lazy" decoding="async" class="wp-image-482 aligncenter" alt="2011Crab" src="http://192.185.17.126/~cwtwist/wp-content/uploads/2013/06/2011crab.jpg?w=1024" width="540" height="406" srcset="http://clockworktwist.com/wp-content/uploads/2013/06/2011crab.jpg 1600w, http://clockworktwist.com/wp-content/uploads/2013/06/2011crab-300x225.jpg 300w, http://clockworktwist.com/wp-content/uploads/2013/06/2011crab-1024x768.jpg 1024w" sizes="(max-width: 540px) 100vw, 540px" /></a></p>
<p style="text-align:center;">
<p style="text-align:center;">Are you an artist/photographer/sculptor who loves Steampunk as much as I do?   Would you like to see your work featured on this blog?  Or, do you know of someone else who&#8217;s work you adore?  Please leave a comment on this post with a link or two!   I&#8217;ll happily feature anything that I think will fit the style of my blog.  And even if I don&#8217;t feature it, please please leave your info in a comment anyway!  More art is always better than less.</p>
